create table if not exists file
(
    file_id           bigserial not null constraint file_pkey primary key,
    category          varchar(255),
    created_date      timestamp,
    file_name         varchar(255),
    file_uri_crop     varchar(255),
    file_uri_original varchar(255),
    order_no          integer,
    size              bigint,
    status            integer
);

alter table file
    owner to postgres;

